import axios from "axios";
import { getAllProducts, getProductById } from "./productSlice";

export const getProducts = (dispatch) => {
    axios("http://localhost:3001/pokemon/get/").then(res => dispatch(getAllProducts(res.data.results))).catch(error => console.log(error))
}
